import styled from 'styled-components';

export const CoordinateCard = ({ item }) => {
  return (
    <ItemCard>
      <div>{item.image}</div>
    </ItemCard>
  );
};

const ItemCard = styled.div`
  border: 1px solid #a9a9a9;
  margin: 16px;
  width: 200px;
  height: 300px;
  border-radius: 10px;
  justify-content: space-between;
  background-color: #ffffff;
`;
